import React, { useState, useEffect } from 'react';

function TotalStoryPointBarChart() {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch('http://localhost:4000/api/available-sp')
      .then(response => {
        if (!response.ok) {
          throw new Error('Failed to fetch data');
        }
        return response.json(); // Parse JSON data
      })
      .then(data => {
        console.log('Fetched data:', data); // Log the fetched data
        setData(data); // Set data to state
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }, []);

  console.log('State data:', data); // Log the state data

  return (
    <div>
      <h1>Available Story Points</h1>
      {data && data.map(issue => (
        <div key={issue.id}>
          <p>Issue Key: {issue.key}</p>
          <p>Issue ID: {issue.id}</p>
          {/* Render other relevant fields */}
        </div>
      ))}
    </div>
  );
}

export default TotalStoryPointBarChart;
